import React from 'react'

const WeatherBox = ({weather}) => {
    // console.log("weather?", weather);
  return (
    <div className="weather-box">
      <h5 key={index} id="weatherInfo" className="city-deco">{weather?.name}</h5>
      <h2 key={index} id="weatherInfo">{weather?.main.temp}°C / {parseFloat(((weather?.main.temp*9/5)+32)).toFixed(2)}°F</h2>
      <h4 key={index} id="weatherInfo">{weather?.weather[0].description}</h4>
      <h4 key={index} id="weatherInfo">Humidity: {weather?.main.humidity}%</h4>
    </div>
  )
}

export default WeatherBox
